<H1>user-level</H1><!-- entering slot 748 -->
<P>
user-level
<P>
Term used to describe an application resource that is currently undergoing
modification and unit testing;  when unit testing is complete, the resource
is then submitted for baselining and subsequent promotion to production
level.
